import React from 'react';
import styles from "./contacts.module.css"

function MyMap() {

  return (
    <div id={styles.map}>
      <div className="container">
        <div className={styles.map_content}></div>
        <div></div>

        <img className={styles.img1} src="https://lh3.googleusercontent.com/p/AF1QipNekB2vsmsI_VVDm3mEFr5dWOjWZjX8wUvptVkB=s1360-w1360-h1020" alt =""></img>
      </div>

    </div>
  );
}

export default MyMap
